import './App.css';
import Car from './components/Car';
import BlogPage from './components/BlogPage';
function App() {

  const carList = [
    { brand:"BMW", color:"Red"  },
    { brand:"Ford", color:"Blue"  },
    { brand:"Tesla", color:"Green"  },
  ]

  return (
    <>

      <BlogPage carList = {carList}/>
      <Car />
    </>

  );
}

export default App;
